  [],\n\t\"num_tags\": 41,\n\t\"name\": \"nabat-2014-survey-results-baca-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report is on the 2014 NABat survey
  results from Baca National Wildlife Refuge.  The North American Bat Monitoring Program
  (NABat) is a national program to monitor bats and provide data to aid in conservation
  of bat populations across the continent. The program will use four approaches to
  gather the monitoring data to assess changes in bat distributions and abundances:
  these include winter hibernaculum counts, maternity colony counts, mobile acoustic
  surveys along road transects, and acoustic surveys at stationary points. The summer
  of 2014 was the pilot effort for initiation of the surveys nationally, and here
  in Colorado. The Colorado Natural Heritage Program (CNHP) was tasked with the planning
  and coordination of the acoustic surveys, and conducting some surveys around the
  state in partnership with Colorado Parks and Wildlife (CPW). Within the NABat sampling
  scheme, sample grids are 10 x 10 km (100 km2) cells, ordered using a randomized
  sampling approach. CNHP conducted the selection process of the grid cells to be
  used in the pilot effort, which included an evaluation of the ordered list of all
  grids in the state based on accessibility, roads, and landownership. The grid priority
  list was provided by the NABat program, and because it was only available late in
  the survey season, landownership was a significant factor in the evaluation and
  grid selection process. Survey of selected sample grids was conducted by CPW and
  CNHP for both stationary and mobile acoustic surveys. Grid cell 2797 was one of
  the selected grids for use in the 2014 NABat survey in Colorado. This grid falls
  mostly on the Baca National Wildlife Refuge, with a portion of the eastern edge
  of the grid on lands managed by the Great Sand Dunes National Park, in the San Luis
  Valley of south-central Colorado. This grid represents an excellent survey location
  for the NABat program, because of the ownership, access and vandalism issues are
  not concerns for deployment of equipment and data protection. Additionally, Baca
  NWR personnel are supportive and assisted in the deployment and take down of the
  equipment, and providing supporting information regarding the survey sites and weather
  conditions during the survey period. The 2797 grid was also used in the 2015 survey
  effort for the NABat program, and remains in the program for Colorado. Analysis
  of that data is still underway.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
